  "text": "Diye gaye numbers ke array ko sort karne ka algorithm

def sort(array): 
    # tamam elements ke through loop kariye
    for i in range(len(array)):
        # current element ko select kariye
        current = array[i]
        # array mein sabse chhota element dhundiye
        min_index = i
        for j in range(i + 1, len(array)):
            if array[j] < array[min_index]:
                min_index = j
        # sabse chhote element aur current element ko swap kariye
        array[min_index], array[i] = array[i], array[min_index]
    return array

if __name__ == '__main__':
    print(sort([7, 1, 3, 5, 9]))"
}
